$("#set-status .btn").on("click",t=>{let s={postId:"<%= app._id %>",status:t.target.value};$.ajax({type:"POST",url:"/iha-admin/application/setStatus",data:s,dataType:"json",success:t=>{$("#succesmsg").children(".toast-body").text(t.message),$("#succesmsg").toast("show"),setTimeout(()=>{location.reload()},2e3)}})});